,fac_korat:"コラート工場",fac_bangplee_addr:"438 Moo 17, Tambol Bangsaothong, Amphur Bangsaothong, Samutprakarn 10570 Thailand",fac_bangplee_tel:"Tel: 02-706-7800-4 Fax: 02-706-7805-6",fac_korat_addr:"999/10 Moo 1, Mittraphap Rd., Tambol Naklang, Amphur Soongnuen, Nakhon Ratchasima 30380 Thailand",fac_korat_tel:"Tel: 044-009-575, 044-009-577 Fax: 044-009-578",aboutFac:"会社概要",q1:"SAMTはどんな会社ですか？",a1:"金型製作をメインに、製造業が元気になるサービスを提供する会社です。",q2:"どんな金型を製作していますか？",a2:"135 ～ 2,550 tonクラスのダイキャスト金型を製作しています。",q3:"金型以外のサービスは何がありますか？",a3:"どこの企業にもあるデッドストックになっている品物を売買できるECサイト「ARCANA」、金型に使うシリンダーを再利用できるようにメンテナンスするサービス等を展開しています。",q4:"ARCANAとは？",a4:"ARCANAは新規顧客開拓と在庫解消を支援するビジネスプラットフォームです。新商品やデッドストックを販売し、幅広い顧客層にリーチできます。お気軽にご連絡ください。",a4Link:"詳しくはこちら",a4LinkUrl:"https://arcana-onlineshop.com/ja",a5LinkUrl:"/services/eco-cylinder",a5Link:"詳しくはこちら",q5:"エコシリンダーサービスとはどんなサービスですか？",a5:"油圧シリンダーの修理サービスです。 環境にもやさしく、故障する前に修理することで故障リスクを大幅に低減させ、シリンダーの長寿命化を図ります。お気軽にお問合せください。",q6:"環境に配慮した取り組みは何かされていますか？",a6:"取り組みのひとつとして、環境に配慮した事業「ARCANA」と「エコシリンダーサービス」をはじめました。SAMTは今後も積極的に環境にやさしいものづくり・サービスに取り組んでまいります。",q7:"金型製作に関しSAMTが他社と違うところは主にどんなところですか？",a7:"高品質な金型を供給できるだけでなく、お客様の生産性向上に一緒に取り組み、お客様のお困りごとを解決いたします。常にお客様のためになることにチャレンジしたいと思っています！どんなことでもぜひご相談ください。",cookie:"This website uses cookies to ensure you get the best experience on our website.",accept:"Accept",samt_des:"お客様にとってのベストバリューを提供いたします",samt:"SHIPPO ASAHI MOULDS",company_des:"従業員が幸せに働ける職場環境を作る",samt_benefit:"SAMTの福利厚生",samt_benefit_des:"従業員の幸福を保つ",intern:"インターン・実習生",here:"こちらに",can_contact:"御社の工業製品も",st_h1:"高精度金型技術",st_h2:"大型金型の製造",st_h3:"お客様の要件に応じた製品開発",st_des1:"私たちは大手自動車部品メーカーからの依頼を受け、一流の精度要求を満たすために、設立以来培ってきた技術と最新の金型製造技術を駆使して製造しています。",st_des2:"私たちは135トンから2500トンクラスまでの幅広い生産能力を持っています。大型設備を導入しており、最大2500トンまでの大型金型を高速・高精度で加工することができます。",st_des3:"私たちは、信頼性のある金型製造技術を用いた新しい金型製造を提供する準備ができています。お客様をサポートするために、挑戦を続けてまいります。",high_quality:"高品質",low_price:"低価格",ontime:"納期厳守",numberOne:"わたしたちはお客様に最適な価値提供を行ないます。",index_h1:"ビジネスをよりスムーズかつ効率的に運営するお手伝いをします。",index_s1:"すべての必要なものを1つの解決策で、サムトに揃えました。",index_des:"SAMTは産業製品の製造に必要不可欠です。私たちは「ダイカスト金型」の設計と製造を行っています。自動車部品の中でもアルミニウム部品の大量生産に不可欠なパワートレインおよびドライブライン部品の金型を製造しています。私たちの金型は高性能で高品質かつ高精度で、世界中の製造業者に納品しています。",work_des:"当社は自動車、二輪車部品を中心に、高性能・高品質・高精度の金型を設計・製造しています。生産能力は135t ～2550t まで幅広く対応しており、輸出実績も多数ございます。長年培った金型技術と提案力でお客様のお困りごとを解決し、最適なご提案をいたします。",smc_service:"SAMTは、設計から製造までの包括的なサービスを提供しています。",p_h1:"ダイキャスト金型の設計・製造",p_h2:"WHAT IS A DIE CASTING MOULDS?",p_h3:"OUR PRODUCTS",p_h4:"WE PRODUCE MOULD SIZES FROM 135T TO 2500T.",p_h5:"Aluminum die casting technology",p_h6:"OUR PRODUCTION EQUIPMENTS",p_s1:"お客様に最適なご提案をいたします",p_s2:"DIE CASTING MOULDS IS",p_s3:"SAMT HAS BEEN WORKING WITH LEADING AUTOMOBILE PARTS MANUFACTURERS.",p_des2:"ガソリン車・電気自動車(EV)・二輪・船舶・弱電用等のダイキャスト金型を製作しています。経験豊富な社員がお客様の様々なご要望にお応えし高品質な金型を提供いたします。「立ち上げ期間を短くしたい」、「修正を少なくしたい」など、お困りごとがあればどんなことでもぜひお気軽にご相談ください。",p_des4:"SAMT works with leading auto parts manufacturers. We produce moulds sizes from 135 T to 2500T.",p_des5:"It is die casting moulds factory that can perform integrated production from design to moulds assembly and product inspection. Since its founding in 1993, SAMT has been walking with automobile parts manufacturers. To meet the diverse needs of our customers, Moulds technology has been cultivated since its establishment, We propose high-performance, high-quality, high-precision moulds.",photo_list:"機械設備",acana_head:"ARCANA Online",acana_des:"ARCANAは工業製品の販売サイトです。いらなくなった工業製品を高く、ほしい工業製品を安く手に入れることができます。御社の工業製品も",acana_h1:"ARCANAとは？",acana_h2:"こんなことに困っていませんか？",acana_h3:"ARCANAなら解決できます",acana_h4:"ARCANA で売れるもの",acana_h5:"ARCANAで買えるもの",acana_h6:"簡単出品、充実したサポート体制！無料で始められます。",acana_des1:"ARCANAはビジネスの可能性を広げるプラットフォームです。",acana_des2:"✅新規事業の販売先が見つからない\n✅開発した新製品が既存顧客層にマッチしない \n✅在庫にあるけれど使っていないデッドストックがある",acana_des3:"\uD83D\uDCA1新規顧客開拓　\n　幅広い企業や消費者が集うARCANAは、これまでリーチできなかった顧客層へのアプローチを実現します。\n\uD83D\uDCA1在庫解消\n　眠っていた在庫をARCANAで販売することで、新たな収益元を生み出します。",acana_des4:"①新商品：発売したばかりの商品や未発売の商品\n②デッドストック：未使用の製品　\nくわしくはこちら",acana_des5:"・工具 \n・部品\n・スポーツ用品\n・生活用品\n・その他",acana_des